  false,\n\t\"url\": null,\n\t\"notes\": \"Zoning district boundaries by type and
  classification. Chicago is divided into zoning districts that regulate land use
  activities across the city. Data is based on the Chicago Zoning Ordinance and Land
  Use Ordinance http://bit.ly/9eqawi.  Zoning Types are defined in this ordinance.
  To view or use these files, compression software and special GIS software, such
  as ESRI ArcGIS, is required. For additional information about business uses, review
  the License/Zoning Reference (LZR) Guide http://bit.ly/vvGzne, which is based on
  the Municipal Code and is intended to assist business owners in determining the
  proper zoning district and primary business license for specific business types.
  Update Frequency: Data is updated monthly. Related Applications: Zoning Map https://gisapps.cityofchicago.org/zoning/\",\n\t\"license_title\":
